// BasicInfo.js

import React from 'react';

const BasicInfo = ({ person }) => (
  <div className="App">
    <h1>{person.name}</h1>
    <h2>{person.title}</h2>
    <p>{person.phoneNumber}</p>
    {/* Add other content based on the properties of the person object */}
  </div>
);

export default BasicInfo;
